    "# === SELECIONA AUTOMATICAMENTE AS VARI√ÅVEIS NUM√âRICAS MAIS RELEVANTES PARA O TARGET \"ATTRITION\" ===\n",
    "\n",
    "#  Seleciona colunas num√©ricas\n",
    "numeric_cols = df.select_dtypes(include=np.number).columns.tolist()\n",
    "\n",
    "# Remove automaticamente colunas irrelevantes (constantes e identificadores)\n",
    "const_cols = [col for col in numeric_cols if df[col].nunique() == 1]\n",
    "id_like_cols = [col for col in numeric_cols if df[col].nunique() == len(df)]\n",
    "cols_to_remove = const_cols + id_like_cols\n",
    "useful_numeric_cols = [col for col in numeric_cols if col not in cols_to_remove]\n",
    "\n",
    "# Define X e y com as colunas limpas\n",
    "X_num = df[useful_numeric_cols]\n",
    "y_num = df['Attrition'].map({'Yes': 1, 'No': 0})\n",
    "\n",
    "# Seleciona as 6 mais relevantes com SelectKBest + f_classif\n",
    "from sklearn.feature_selection import SelectKBest, f_classif\n",
    "selector = SelectKBest(score_func=f_classif, k=6)\n",
    "selector.fit(X_num, y_num)\n",
    "\n",
    "# Resultado\n",
    "selected_num_features = X_num.columns[selector.get_support()].tolist()\n",
    "print(\"Vari√°veis num√©ricas mais relevantes:\", selected_num_features)\n",
