    "    def __init__(self, use_gpu=True, use_poly=True):\n",
    "        self.use_gpu = use_gpu # Define se o LightGBM usar√° GPU\n",
    "        self.use_poly = use_poly  # Ativa ou n√£o vari√°veis polinomiais\n",
    "        self.models = {} # Dicion√°rios para armazenar os modelos treinados\n",
    "        self.results = {} # Dicion√°rios para armazenar resultados de avalia√ß√£o\n",
    "        self.preprocessor = None # Placeholder para o pr√©-processador de dados (ColumnTransformer)\n",
    "        self.feature_names = None # Lista com os nomes finais das features ap√≥s transforma√ß√£o\n",
    "\n",
    "    def load_and_prepare_data(self, df):\n",
    "        \"\"\"Carrega e prepara os dados para modelagem\"\"\"\n",
    "        print(\"=== Prepara√ß√£o dos Dados ===\")\n",
    "        print(f\"Shape inicial: {df.shape}\")\n",
    "    \n",
    "        # Lista de colunas que devem ser mantidas mesmo que pare√ßam constantes ou identificadores\n",
    "        important_cols = ['PerformanceRating', 'JobLevel']  # Adicione outras se necess√°rio\n",
    "    \n",
    "        # Detecta colunas constantes (sem variabilidade), exceto as que queremos manter\n",
    "        const_cols = [col for col in df.columns if df[col].nunique() == 1 and col not in important_cols]\n",
    "    \n",
    "        # Detecta colunas que parecem identificadores √∫nicos (ex: IDs), exceto as que queremos manter\n",
    "        id_like_cols = [col for col in df.columns if df[col].nunique() == len(df) and col not in important_cols]\n",
    "    \n",
    "        # Junta as colunas a serem removidas e as remove do DataFrame\n",
    "        cols_to_drop = const_cols + id_like_cols\n",
    "        df = df.drop(columns=cols_to_drop)\n",
    "    \n",
    "        # Armazena internamente os nomes das colunas que foram removidas (caso precise rastrear depois)\n",
    "        self.removed_columns = cols_to_drop\n",
    "    \n",
    "        # Informa ao usu√°rio quais colunas foram removidas\n",
    "        print(f\"Colunas removidas (constantes ou identificadores): {cols_to_drop}\")\n",
    "    \n",
    "        # Separa o target (y) da base de features (X)\n",
    "        X = df.drop('Attrition', axis=1)\n",
    "        y = df['Attrition'].map({'Yes': 1, 'No': 0})  # Converte 'Yes'/'No' para 1/0\n",
    "    \n",
    "        # Mostra a distribui√ß√£o do target para analisar desbalanceamento\n",
    "        print(f\"\\nDistribui√ß√£o do target:\")\n",
    "        print(y.value_counts(normalize=True))\n",
    "    \n",
    "        return X, y\n",
    "\n",
    "    def create_features(self, X):\n",
    "        \"\"\"Cria features adicionais atrav√©s de feature engineering\"\"\"\n",
    "        print(\"\\n=== Feature Engineering ===\")\n",
    "        X_eng = X.copy()\n",
    "    \n",
    "        # ====== FEATURES NUM√âRICAS DERIVADAS ======\n",
    "    \n",
    "        # Renda mensal dividida pela idade: proxy de progress√£o de carreira (renda mais alta em menos tempo indica sucesso/acelera√ß√£o)\n",
    "        X_eng['IncomeToAge'] = X_eng['MonthlyIncome'] / X_eng['Age']  \n",
    "    \n",
    "        # Total de anos de experi√™ncia dividido pelo n√∫mero de empresas: mede estabilidade ou rotatividade de carreira\n",
    "        X_eng['YearsPerCompany'] = X_eng['TotalWorkingYears'] / (X_eng['NumCompaniesWorked'] + 1)  \n",
    "    \n",
    "        # Mede quanto tempo a pessoa est√° sem ser promovida proporcionalmente ao tempo de empresa: √∫til para entender estagna√ß√£o\n",
    "        X_eng['YearsWithoutPromotion'] = X_eng['YearsSinceLastPromotion'] / (X_eng['YearsAtCompany'] + 1)  \n",
    "    \n",
    "        # Renda ajustada pelo n√≠vel educacional: verifica retorno financeiro por n√≠vel de forma√ß√£o (poss√≠vel insatisfa√ß√£o por subvaloriza√ß√£o)\n",
    "        X_eng['IncomeToEducation'] = X_eng['MonthlyIncome'] / X_eng['Education']  \n",
    "    \n",
    "        # Dist√¢ncia ponderada pela satisfa√ß√£o ambiental: alto desgaste no trajeto pode impactar no desejo de sair\n",
    "        X_eng['DistanceSatisfactionRatio'] = X_eng['DistanceFromHome'] / (X_eng['EnvironmentSatisfaction'] + 1)  \n",
    "    \n",
    "        # ====== FEATURES BIN√ÅRIAS (1/0) ======\n",
    "    \n",
    "        # Indica se a dist√¢ncia de casa √© elevada (mais de 20km) ‚Äî pode contribuir para o desejo de desligamento\n",
    "        X_eng['HighDistance'] = (X_eng['DistanceFromHome'] > 20).astype(int)  \n",
    "    \n",
    "        # Identifica pessoas com satisfa√ß√£o muito baixa em qualquer um dos crit√©rios (risco elevado de sa√≠da)\n",
    "        X_eng['LowSatisfaction'] = ((X_eng['JobSatisfaction'] == 1) |\n",
    "                                    (X_eng['EnvironmentSatisfaction'] == 1) |\n",
    "                                    (X_eng['RelationshipSatisfaction'] == 1)).astype(int)  \n",
    "    \n",
    "        # Identifica funcion√°rios h√° mais de 5 anos sem promo√ß√£o ‚Äî poss√≠vel desmotiva√ß√£o ou estagna√ß√£o\n",
    "        X_eng['NoPromotion'] = (X_eng['YearsSinceLastPromotion'] > 5).astype(int)  \n",
    "    \n",
    "        # Marca os funcion√°rios com nota m√°xima de desempenho ‚Äî podem estar sendo assediados por mercado externo\n",
    "        X_eng['HighPerformer'] = (X_eng['PerformanceRating'] == 4).astype(int)  \n",
    "    \n",
    "        # Indica jovens (<30) em cargos de alto n√≠vel (JobLevel ‚â• 3): ambi√ß√£o alta e poss√≠veis expectativas n√£o atendidas\n",
    "        X_eng['YoungHighLevel'] = ((X_eng['Age'] < 30) & (X_eng['JobLevel'] >= 3)).astype(int)  \n",
    "    \n",
    "        # ====== FEATURES COMPOSTAS ======\n",
    "    \n",
    "        # Score m√©dio de satisfa√ß√£o em tr√™s dimens√µes: vis√£o hol√≠stica da satisfa√ß√£o no trabalho\n",
    "        X_eng['SatisfactionScore'] = (X_eng['JobSatisfaction'] +\n",
    "                                      X_eng['EnvironmentSatisfaction'] +\n",
    "                                      X_eng['RelationshipSatisfaction']) / 3  \n",
    "    \n",
    "        # Composi√ß√£o da intensidade de trabalho: soma efeito de horas extras e frequ√™ncia de viagens\n",
    "        X_eng['WorkIntensity'] = (X_eng['OverTime'].map({'Yes': 2, 'No': 1}) *\n",
    "                                  X_eng['BusinessTravel'].map({'Non-Travel': 1,\n",
    "                                                              'Travel_Rarely': 2,\n",
    "                                                              'Travel_Frequently': 3}))  \n",
    "    \n",
    "        # ====== FEATURES CATEG√ìRICAS CRIADAS ======\n",
    "    \n",
    "        # Categoriza idade em grupos: √∫til para capturar efeitos geracionais e aplicar fairness depois\n",
    "        X_eng['AgeGroup'] = pd.cut(X_eng['Age'], bins=[0, 25, 35, 45, 55, 100],\n",
    "                                   labels=['<25', '25-35', '35-45', '45-55', '55+'])  \n",
    "    \n",
    "        # Divide a renda mensal em 5 grupos: permite entender padr√µes entre classes salariais\n",
    "        X_eng['IncomeGroup'] = pd.qcut(X_eng['MonthlyIncome'], q=5,\n",
    "                                       labels=['VeryLow', 'Low', 'Medium', 'High', 'VeryHigh'])  \n",
    "    \n",
    "        # Impress√£o do total de novas vari√°veis criadas\n",
    "        print(f\"Features criadas: {X_eng.shape[1] - X.shape[1]}\")\n",
    "        print(f\"Total de features: {X_eng.shape[1]}\")\n",
    "    \n",
    "        return X_eng\n",
    "\n",
    "\n",
    "    def create_polynomial_features(self, X, y=None, k=30):\n",
    "        \"\"\"\n",
    "        Gera automaticamente intera√ß√µes de segundo grau entre vari√°veis num√©ricas.\n",
    "        Se y for fornecido, usa SelectKBest para selecionar as top k features polinomiais.\n",
    "        \"\"\"\n",
    "        print(\"\\n=== Gerando Features Polinomiais ===\")\n",
    "        numeric_cols = X.select_dtypes(include=[np.number]).columns\n",
    "    \n",
    "        # Cria intera√ß√µes de grau 2 entre vari√°veis num√©ricas (ex: Age * Income)\n",
    "        poly = PolynomialFeatures(degree=2, interaction_only=False, include_bias=False)\n",
    "        X_poly = poly.fit_transform(X[numeric_cols])\n",
    "    \n",
    "        # Gera DataFrame com as novas features\n",
    "        poly_feature_names = poly.get_feature_names_out(numeric_cols)\n",
    "        df_poly = pd.DataFrame(X_poly, columns=poly_feature_names, index=X.index)\n",
    "    \n",
    "        print(f\"Total de features polinomiais: {df_poly.shape[1] - len(numeric_cols)}\")\n",
    "    \n",
    "        if y is not None and k is not None:\n",
    "            # Aplica SelectKBest para escolher as top-k vari√°veis polinomiais mais relevantes\n",
    "            print(f\"Selecionando as top {k} features com SelectKBest...\")\n",
    "            selector = SelectKBest(score_func=f_classif, k=k)\n",
    "            df_poly_selected = selector.fit_transform(df_poly, y)\n",
    "    \n",
    "            selected_feature_names = np.array(poly_feature_names)[selector.get_support()]\n",
    "            df_poly = pd.DataFrame(df_poly_selected, columns=selected_feature_names, index=X.index)\n",
    "            print(f\"Features polinomiais selecionadas: {len(selected_feature_names)}\")\n",
    "            print(\"Features polinomiais selecionadas:\\n\", selected_feature_names)\n",
    "    \n",
    "        # Concatena com as features originais\n",
    "        X_enriched = pd.concat([X, df_poly], axis=1)\n",
    "        return X_enriched\n",
    "\n",
    "    def create_preprocessor(self, X):\n",
    "        \"\"\"Cria o preprocessador para as features\"\"\"\n",
    "    \n",
    "        # Identificar colunas num√©ricas (int, float) e categ√≥ricas (object, category, etc.)\n",
    "        numeric_features = X.select_dtypes(include=[np.number]).columns.tolist()\n",
    "        categorical_features = X.select_dtypes(exclude=[np.number]).columns.tolist()\n",
    "    \n",
    "        print(f\"\\nFeatures num√©ricas: {len(numeric_features)}\")\n",
    "        print(f\"Features categ√≥ricas: {len(categorical_features)}\")\n",
    "\n",
    "        print(f\"\\nFeatures num√©ricas ({len(numeric_features)}):\")\n",
    "        for feat in numeric_features:\n",
    "            print(f\"  - {feat}\")\n",
    "\n",
    "        print(f\"\\nFeatures categ√≥ricas ({len(categorical_features)}):\")\n",
    "        for feat in categorical_features:\n",
    "            print(f\"  - {feat}\")\n",
    "    \n",
    "        numeric_transformer = StandardScaler() # Criar transformador para vari√°veis num√©ricas: padroniza (m√©dia = 0, desvio = 1)\n",
    "    \n",
    "        # Criar transformador para vari√°veis categ√≥ricas: one-hot encoding (ignora primeira categoria para evitar multicolinearidade)\n",
    "        categorical_transformer = OneHotEncoder(drop='first', sparse_output=False)\n",
    "    \n",
    "        # Combinar transformadores em um √∫nico pr√©-processador com ColumnTransformer\n",
    "        # Cada grupo de colunas ser√° tratado por seu respectivo transformador\n",
    "        preprocessor = ColumnTransformer(\n",
    "            transformers=[\n",
    "                ('num', numeric_transformer, numeric_features),  # Aplica o scaler nas num√©ricas\n",
    "                ('cat', categorical_transformer, categorical_features)  # Aplica o one-hot nas categ√≥ricas\n",
    "            ])\n",
    "    \n",
    "        return preprocessor, numeric_features, categorical_features # Retorna o objeto de pr√©-processamento e os nomes das colunas por tipo\n",
    "\n",
    "    def optimize_hyperparameters(self, X_train, y_train, model_name, n_trials=40): #n_trials ajustado - era 50\n",
    "        \"\"\"Otimiza hiperpar√¢metros usando Optuna\"\"\"\n",
    "    \n",
    "        print(f\"\\n=== Otimizando {model_name} ===\")\n",
    "    \n",
    "        # Garante que os dados estejam no formato numpy arrays\n",
    "        if not isinstance(X_train, np.ndarray):\n",
    "            X_train = np.array(X_train)\n",
    "        if not isinstance(y_train, np.ndarray):\n",
    "            y_train = np.array(y_train)\n",
    "    \n",
    "        # Estrat√©gia de valida√ß√£o cruzada estratificada\n",
    "        cv = StratifiedKFold(n_splits=3, shuffle=True, random_state=42)\n",
    "    \n",
    "        def objective(trial):\n",
    "            # Par√¢metros espec√≠ficos para cada modelo\n",
    "            if model_name == 'RandomForest':\n",
    "                params = {\n",
    "                    'n_estimators': trial.suggest_int('n_estimators', 50, 300),\n",
    "                    'max_depth': trial.suggest_int('max_depth', 3, 20),\n",
    "                    'min_samples_split': trial.suggest_int('min_samples_split', 2, 20),\n",
    "                    'min_samples_leaf': trial.suggest_int('min_samples_leaf', 1, 10),\n",
    "                    'max_features': trial.suggest_categorical('max_features', ['sqrt', 'log2', None]),\n",
    "                    'class_weight': 'balanced',\n",
    "                    'random_state': 42,\n",
    "                    'n_jobs': -1\n",
    "                }\n",
    "                model = RandomForestClassifier(**params)\n",
    "    \n",
    "            elif model_name == 'LogisticRegression':\n",
    "                params = {\n",
    "                    'C': trial.suggest_float('C', 0.001, 10.0, log=True),\n",
    "                    'penalty': trial.suggest_categorical('penalty', ['l1', 'l2']),\n",
    "                    'solver': 'liblinear',\n",
    "                    'class_weight': 'balanced',\n",
    "                    'max_iter': 1000,\n",
    "                    'random_state': 42\n",
    "                }\n",
    "                model = LogisticRegression(**params)\n",
    "    \n",
    "            elif model_name == 'LightGBM':\n",
    "                pos_ratio = np.mean(y_train)\n",
    "                scale_pos_weight = (1 - pos_ratio) / pos_ratio\n",
    "                params = {\n",
    "                    'n_estimators': trial.suggest_int('n_estimators', 50, 300),\n",
    "                    'max_depth': trial.suggest_int('max_depth', 3, 20),\n",
    "                    'learning_rate': trial.suggest_float('learning_rate', 0.01, 0.3, log=True),\n",
    "                    'num_leaves': trial.suggest_int('num_leaves', 10, 100),\n",
    "                    'min_child_samples': trial.suggest_int('min_child_samples', 5, 50),\n",
    "                    'subsample': trial.suggest_float('subsample', 0.5, 1.0),\n",
    "                    'colsample_bytree': trial.suggest_float('colsample_bytree', 0.5, 1.0),\n",
    "                    'scale_pos_weight': scale_pos_weight,\n",
    "                    'random_state': 42,\n",
    "                    'n_jobs': -1,\n",
    "                    'verbose': -1\n",
    "                }\n",
    "                if self.use_gpu:\n",
    "                    params['device'] = 'gpu'\n",
    "                    params['gpu_use_dp'] = False\n",
    "                model = lgb.LGBMClassifier(**params)\n",
    "    \n",
    "            elif model_name == 'RidgeClassifier':\n",
    "                params = {\n",
    "                    'alpha': trial.suggest_float('alpha', 0.1, 10.0, log=True),\n",
    "                    'solver': trial.suggest_categorical('solver', ['auto', 'sag', 'lsqr']),\n",
    "                    'class_weight': 'balanced',\n",
    "                    'random_state': 42\n",
    "                }\n",
    "                model = RidgeClassifier(**params)\n",
    "    \n",
    "            # Valida√ß√£o cruzada\n",
    "            scores = []\n",
    "            for train_idx, val_idx in cv.split(X_train, y_train):\n",
    "                X_fold_train = X_train[train_idx]\n",
    "                y_fold_train = y_train[train_idx]\n",
    "                X_fold_val = X_train[val_idx]\n",
    "                y_fold_val = y_train[val_idx]\n",
    "    \n",
    "                model.fit(X_fold_train, y_fold_train)\n",
    "                y_pred = model.predict_proba(X_fold_val)[:, 1] if hasattr(model, \"predict_proba\") else model.decision_function(X_fold_val)\n",
    "                score = roc_auc_score(y_fold_val, y_pred)\n",
    "                scores.append(score)\n",
    "    \n",
    "            return np.mean(scores)\n",
    "    \n",
    "        # Cria e executa o estudo\n",
    "        study = optuna.create_study(direction='maximize', sampler=TPESampler(seed=42))\n",
    "        study.optimize(objective, n_trials=n_trials, show_progress_bar=True)\n",
    "    \n",
    "        print(f\"Melhor AUC-ROC: {study.best_value:.4f}\")\n",
    "        print(f\"Melhores par√¢metros: {study.best_params}\")\n",
    "    \n",
    "        return study.best_params\n",
    "\n",
    "    def train_models(self, X_train, y_train, X_test, y_test):\n",
    "        \"\"\"Treina todos os modelos com hiperpar√¢metros otimizados\"\"\"\n",
    "        print(\"\\n=== Treinamento dos Modelos ===\")\n",
    "\n",
    "        # Remove colunas duplicadas por nome\n",
    "        duplicated_cols = X_train.columns[X_train.columns.duplicated()].tolist()\n",
    "        if duplicated_cols:\n",
    "            print(f\"‚ö†Ô∏è Colunas duplicadas removidas: {duplicated_cols}\")\n",
    "            X_train = X_train.loc[:, ~X_train.columns.duplicated()]\n",
    "            X_test = X_test.loc[:, ~X_test.columns.duplicated()]\n",
    "\n",
    "        # Preprocessar dados\n",
    "        self.preprocessor, self.numeric_features, self.categorical_features = self.create_preprocessor(X_train)\n",
    "    \n",
    "        X_train_processed = self.preprocessor.fit_transform(X_train)\n",
    "        X_test_processed = self.preprocessor.transform(X_test)\n",
    "    \n",
    "        # Converter para numpy arrays se necess√°rio\n",
    "        if hasattr(X_train_processed, 'toarray'):\n",
    "            X_train_processed = X_train_processed.toarray()\n",
    "        if hasattr(X_test_processed, 'toarray'):\n",
    "            X_test_processed = X_test_processed.toarray()\n",
    "\n",
    "        # Inicializa o algoritmo SMOTE (Synthetic Minority Over-sampling Technique)\n",
    "        # Ele cria amostras sint√©ticas da classe minorit√°ria para balancear o dataset.\n",
    "        smote = SMOTE(random_state=42)\n",
    "        \n",
    "        # Aplica o SMOTE nos dados de treino (j√° pr√©-processados)\n",
    "        # Isso gera novas amostras da classe minorit√°ria para equilibrar as classes\n",
    "        X_train_processed, y_train = smote.fit_resample(X_train_processed, y_train)\n",
    "        # Importante: SMOTE s√≥ √© aplicado ao conjunto de treino (n√£o ao teste!)\n",
    "    \n",
    "        # Armazenar nomes das features ap√≥s one-hot encoding\n",
    "        cat_encoder = self.preprocessor.named_transformers_['cat']\n",
    "        cat_feature_names = []\n",
    "        if hasattr(cat_encoder, 'get_feature_names_out'):\n",
    "            cat_feature_names = cat_encoder.get_feature_names_out(self.categorical_features).tolist()\n",
    "    \n",
    "        self.feature_names = self.numeric_features + cat_feature_names\n",
    "    \n",
    "        # Modelos a treinar\n",
    "        models_config = {\n",
    "            'RandomForest': RandomForestClassifier,\n",
    "            'LogisticRegression': LogisticRegression,\n",
    "            'LightGBM': lgb.LGBMClassifier,\n",
    "            'RidgeClassifier': RidgeClassifier\n",
    "        }\n",
    "    \n",
    "        for model_name, ModelClass in models_config.items():\n",
    "            print(f\"\\n--- {model_name} ---\")\n",
    "            start_time = time.time()\n",
    "    \n",
    "            # Otimizar hiperpar√¢metros\n",
    "            best_params = self.optimize_hyperparameters(\n",
    "                X_train_processed, y_train, model_name, n_trials=20 #alterei n_trials - era 30\n",
    "            )\n",
    "    \n",
    "            # Treinar modelo final\n",
    "            if model_name == 'RandomForest':\n",
    "                model = RandomForestClassifier(**best_params)\n",
    "            elif model_name == 'LogisticRegression':\n",
    "                # Garantir que o solver est√° correto para o modelo final\n",
    "                if 'solver' not in best_params:\n",
    "                    best_params['solver'] = 'liblinear'\n",
    "                model = LogisticRegression(**best_params)\n",
    "            elif model_name == 'LightGBM':\n",
    "                if self.use_gpu:\n",
    "                    best_params['device'] = 'gpu'\n",
    "                    best_params['gpu_use_dp'] = False\n",
    "                model = lgb.LGBMClassifier(**best_params)\n",
    "            elif model_name == 'RidgeClassifier':\n",
    "                model = RidgeClassifier(**best_params)\n",
    "    \n",
    "            model.fit(X_train_processed, y_train)\n",
    "    \n",
    "            # Fazer predi√ß√µes\n",
    "            y_pred = model.predict(X_test_processed)\n",
    "            if hasattr(model, \"predict_proba\"):\n",
    "                y_pred_proba = model.predict_proba(X_test_processed)[:, 1]\n",
    "            else:\n",
    "                y_pred_proba = model.decision_function(X_test_processed)\n",
    "                y_pred_proba = (y_pred_proba - y_pred_proba.min()) / (y_pred_proba.max() - y_pred_proba.min())  # normaliza para 0-1\n",
    "    \n",
    "            # Calcular m√©tricas\n",
    "            metrics = {\n",
    "                'accuracy': accuracy_score(y_test, y_pred),\n",
    "                'precision': precision_score(y_test, y_pred),\n",
    "                'recall': recall_score(y_test, y_pred),\n",
    "                'f1': f1_score(y_test, y_pred),\n",
    "                'auc_roc': roc_auc_score(y_test, y_pred_proba),\n",
    "                'training_time': time.time() - start_time\n",
    "            }\n",
    "    \n",
    "            # Armazenar resultados\n",
    "            self.models[model_name] = model\n",
    "            self.results[model_name] = {\n",
    "                'metrics': metrics,\n",
    "                'predictions': y_pred,\n",
    "                'probabilities': y_pred_proba,\n",
    "                'best_params': best_params\n",
    "            }\n",
    "    \n",
    "            print(f\"AUC-ROC: {metrics['auc_roc']:.4f}\")\n",
    "            print(f\"Tempo de treinamento: {metrics['training_time']:.2f}s\")\n",
    "\n",
    "        # ===== Voting Ensemble (soft) =====\n",
    "        print(\"\\n--- VotingEnsemble ---\")\n",
    "        \n",
    "        # Cria um modelo de vota√ß√£o (ensemble) combinando RandomForest, LightGBM e RidgeClassifier\n",
    "        # A vota√ß√£o 'soft' usa as probabilidades de cada modelo, n√£o apenas a classe final\n",
    "        voting_clf = VotingClassifier(\n",
    "            estimators=[\n",
    "                ('rf', self.models['RandomForest']),         # Modelo RandomForest j√° treinado\n",
    "                ('lgbm', self.models['LightGBM']),           # Modelo LightGBM j√° treinado\n",
    "                # ('ridge', self.models['RidgeClassifier'])    # Modelo Ridge j√° treinado\n",
    "            ],\n",
    "            voting='soft'  # Combina probabilidades (mais robusto que hard voting para classifica√ß√£o bin√°ria)\n",
    "        )\n",
    "        \n",
    "        # Treina o ensemble (basicamente combina as previs√µes dos modelos existentes)\n",
    "        voting_clf.fit(X_train_processed, y_train)\n",
    "        \n",
    "        # Faz predi√ß√µes com o ensemble\n",
    "        y_pred = voting_clf.predict(X_test_processed)\n",
    "        y_pred_proba = voting_clf.predict_proba(X_test_processed)[:, 1]\n",
    "        \n",
    "        # Calcula m√©tricas de avalia√ß√£o para o ensemble\n",
    "        ensemble_metrics = {\n",
    "            'accuracy': accuracy_score(y_test, y_pred),\n",
    "            'precision': precision_score(y_test, y_pred),\n",
    "            'recall': recall_score(y_test, y_pred),\n",
    "            'f1': f1_score(y_test, y_pred),\n",
    "            'auc_roc': roc_auc_score(y_test, y_pred_proba),\n",
    "            'training_time': time.time() - start_time\n",
    "        }\n",
    "        \n",
    "        # Armazena o modelo ensemble e seus resultados no dicion√°rio de modelos/resultados\n",
    "        self.models['VotingEnsemble'] = voting_clf\n",
    "        self.results['VotingEnsemble'] = {\n",
    "            'metrics': ensemble_metrics,\n",
    "            'predictions': y_pred,\n",
    "            'probabilities': y_pred_proba,\n",
    "            'best_params': {'modelo': 'Ensemble (sem tuning)'}  # Agora √© um dicion√°rio\n",
    "        }\n",
    "        \n",
    "        print(f\"AUC-ROC: {ensemble_metrics['auc_roc']:.4f}\")\n",
    "\n",
    "    def recommend_threshold(self, y_test, model_name='VotingEnsemble'):\n",
    "        print(\"\\n=== Otimiza√ß√£o de Threshold ===\")\n",
    "    \n",
    "        # Obt√©m as probabilidades previstas do modelo escolhido\n",
    "        y_proba = self.results[model_name]['probabilities']\n",
    "    \n",
    "        # Gera uma lista de poss√≠veis thresholds entre 0.01 e 0.99\n",
    "        thresholds = np.linspace(0.01, 0.99, 100)\n",
    "    \n",
    "        # Inicializa vari√°veis para armazenar os melhores thresholds\n",
    "        best_f1, best_youden = 0, 0\n",
    "        best_thresh_f1, best_thresh_youden = 0.5, 0.5\n",
    "    \n",
    "        # --- C√ÅLCULO DO MELHOR THRESHOLD COM M√âTRICA DE YOUDEN ---\n",
    "        fpr, tpr, youden_thresh = roc_curve(y_test, y_proba)  # Curva ROC\n",
    "        youden_scores = tpr - fpr  # Estat√≠stica de Youden = sensibilidade - 1 - especificidade\n",
    "        best_youden_idx = np.argmax(youden_scores)  # √çndice do melhor valor\n",
    "        best_thresh_youden = youden_thresh[best_youden_idx]  # Threshold correspondente ao melhor Youden\n",
    "    \n",
    "        # --- C√ÅLCULO DO MELHOR THRESHOLD COM BASE NO F1-SCORE ---\n",
    "        for thresh in thresholds:\n",
    "            y_pred = (y_proba >= thresh).astype(int)  # Converte probabilidade em classe com base no threshold\n",
    "            score = f1_score(y_test, y_pred)  # Calcula o F1-score com esse threshold\n",
    "            \n",
    "            # Atualiza se o F1 for melhor que o anterior\n",
    "            if score > best_f1:\n",
    "                best_f1 = score\n",
    "                best_thresh_f1 = thresh\n",
    "    \n",
    "        # Exibe os resultados\n",
    "        print(f\"Melhor threshold (F1): {best_thresh_f1:.3f} | F1-Score: {best_f1:.4f}\")\n",
    "        print(f\"Melhor threshold (Youden): {best_thresh_youden:.3f} | Youden: {youden_scores[best_youden_idx]:.4f}\")\n",
    "    \n",
    "        # Armazena internamente os thresholds √≥timos para uso posterior\n",
    "        self.thresholds = {\n",
    "            'threshold_f1': round(best_thresh_f1, 3),\n",
    "            'threshold_youden': round(best_thresh_youden, 3)\n",
    "        }\n",
    "\n",
    "        return self.thresholds\n",
    "\n",
